import React from 'react';

const List = ({ people }) => {
  return (
    <>
     
      
        return (
          <article key={id} className='person'>
            <img src={people.profilePicture} alt={name} />
            <div>
              <h4>{name}</h4>
              <p>{age} years</p>
            </div>
          </article>
        );
      })}
    </>
  );
};

export default List;
